INSERT INTO `task` (`Id`, `title`, `subtitle`, `description`, `image`, `created_at`) VALUES
(1, 'La versión 1.20 de Minecraft ya tiene nombre oficial y es “Trail and Tails”', 'Después de una larga espera al fin tenemos nueva información.', 'Minecraft confirma el título oficial de su actualización 1.20, uno de los momentos más esperados del juego este año. Se llamará Trails & Tales por la relevancia de la experimentación con el escenario, el viaje que llevará a los jugadores a descubrir los misterios alrededor de los yacimientos arqueológicos.\r\nLa directora del juego Agnes Larsson ha hecho las siguientes declaraciones: “La actualización 1.20 trata sobre la expresión de sí mismo, específicamente a través de la representación, narrativa y construcción del mundo. Y este viaje, tus senderos, se ligan todos juntos” y “Los mundos de Minecraft pertenecen a los jugadores, al igual que las historias y los caminos sobre esos mundos”.\r\n', , '2023-03-19 02:27:23');
INSERT INTO `task` (`Id`, `title`, `subtitle`, `description`, `image`, `created_at`) VALUES
(2, 'La beta de Diablo 4 se estrena con problemas de conectividad', 'Emocionante, pero con trabajo por delante.', 'Ayer a las 12:00 de la tarde hora mexicana comenzó el acceso anticipado de la beta abierta de Diablo IV, la esperadísima nueva entrega del juego de rol y acción de Blizzard que se lanzará de forma oficial el 6 de junio para PC, PS5, PS4, XSX/S y Xbox One.\r\nEste acceso anticipado estará disponible hasta el próximo 20 de marzo para aquellos que hayan comprado con anticipación el juego y, la semana que viene, llegará la beta abierta real, aunque parece que Blizzard va a tener que trabajar duro a nivel de conectividad ya que, como era de esperar, los primeros compases del acceso anticipado han venido con varios errores.\r\nDebido a que varios jugadores han sufrido diversos problemas de conectividad comenzando por largas colas de más de una hora de duración, caídas de los servidores, problemas para conectarse a una partida o salidas abruptas al menú principal mientras están jugando, todos errores relacionados con la conexión a internet.\r\n', , '2023-03-19 00:01:45');
INSERT INTO `task` (`Id`, `title`, `subtitle`, `description`, `image`, `created_at`) VALUES
(3, 'Se especula posible secuela sobre el popular juego Atomic Heart ', '¿Volveremos a esta gran utopía fallida? ', ' El periodista Aleksey Makarenkov ha traído ahora buenas noticias al asegurar que la compañía a cargo de este first person shooter, que ya es rentable, ya estaría trabajando en una secuela. O por lo menos ya la tendría en mente, puesto que hay que tener presente que faltan los DLC de Atomic Heart, que irán llegando poco a poco.\r\nSi esta supuesta secuela sobre Atomic Heart llega a entrar en desarrollo se espera que esta tardara bastante tiempo en llegar teniendo en cuenta que la primera entrega tardó cinco años en desarrollarse, aunque parte del trabajo ya estaría hecho si se siguen los mismos esquemas y códigos que este título protagonizado por P-3.\r\n', , '2023-03-19 00:18:55');
INSERT INTO `task` (`Id`, `title`, `subtitle`, `description`, `image`, `created_at`) VALUES
(4, 'Un desarrollador de Team Cherry comenta qué “La esperanza merecerá la pena” refiriendoce al desarrollo de Hollow Knight Silk Son', 'Estamos cada vez más cerca del lanzamiento.', 'Team Cherry ha ofrecido información de Hollow Knight: Silksong con cuentagotas, pero tratándose de uno de los metroidvania más esperados desde que Hollow Knight debutase en 2017, los fans esperan ansiosos cualquier noticia de este plataformas con acción. Pero la espera merecerá la pena, asegura un tester en el Discord oficial del juego que habría probado una versión en desarrollo.\r\nCitando textualmente \"Lo siento por todos, realmente quiero que este juego se lance tan pronto como sea posible y los testers y Team Cherry estamos trabajando para que lo podáis tener. Se lanzará y será un juego glorioso por el que merece la pena esperar\". Lo cual nos da a los jugadores esperanzas sobre el lanzamiento de este. \r\n', , '2023-03-19 02:28:16');
INSERT INTO `task` (`Id`, `title`, `subtitle`, `description`, `image`, `created_at`) VALUES
(5, 'Encuentran evidencias de un modo cooperativo en Hogwarts Legacy', '¿Se viene modo cooperativo?', 'Los dataminers han hallado una función de diálogo/compañero que parece que se eliminó en la creación del juego.\r\nEsta función de compañero permitiría llevar un compañero de clase a las misiones. Las líneas de voz encontradas son frases de los compañeros uniéndose a ti en las misiones.\r\nDesconocemos si esto se descartó por completo o si tal vez en el futuro lo añadan como función adicional. Lo que está claro es que en algún momento del desarrollo lo consideraron.\r\n', , '2023-03-19 19:08:44');

